import React, { useEffect, useState } from 'react'
import { userService } from '../services/usersService'
import { blue } from '../assets/img'
// import { require } from '../assets/img.png'

export function Profiles() {
    const [users, setUsers] = useState([])

    useEffect(async () => {
        const users = await userService.getUsers()
        setUsers(users)

    }, [])
    return (
        <div className="profile-page">
            <img className="nav-logo" src="https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg" alt="" />
            <h1>Mangment profiles</h1>
            <img src={blue} alt="" />
            <div className="main-users">
                {users.map((user, idx) => {
                    return <div key={idx}>
                        {/* <img src={require(`../assets/img/${user.color}.png`)} alt="" /> */}
                        <h1>{user.name}</h1>
                    </div>
                })}
            </div>
            <button>Done</button>
        </div>
    )
}
